import React from "react";
import bg from "../images/servicebg.avif";
function Services() {
  return (
    <div>
      <div
        style={{
          backgroundImage: `url(${bg})`,
          width: "100%",
          height: "100vh",
          position: "relative",
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      ></div>
    </div>
  );
}

export default Services;
